// components/Popup.js

import React from "react";
import styles from "./Popup.module.css";

const Popup = ({ message }) => {
  return (
    <div className={styles.popupContainer}>
      <div className={styles.popupContent}>
        <span className={styles.closeBtn}>&times;</span>
        <p>{message}</p>
      </div>
    </div>
  );
};

export default Popup;
